import React from 'react';
import './logIn.css';
import signUp from 'src\signUpStudents.png'


function LogIn() {
    return (
        <div className="signUp">
        <img class="signUp" src={signUp} alt="signup-image"/>

        </div>
        
    );
}

export default LogIn;
